//Converts the binary inputs from the sw to usable values
int get_col_input(int sw_in){
    int power = 0;

    while(sw_in != 0){
        sw_in = sw_in/2;

        if(sw_in == 0){
            break;
        }

        power++;
    }

    return power;
}

